import React, { useState } from "react";
import jsPDF from "jspdf";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    jobAddress: "",
    jobType: "",
    insuranceCompany: "",
    claimNumber: "",
    techNotes: "",
  });

  const [rooms, setRooms] = useState([
    { name: "Living Room", moisture: "", photo: null },
  ]);

  const [aiSummary, setAiSummary] = useState("");
  const [loadingAI, setLoadingAI] = useState(false);

  // Handle form change
  const handleChange = (e) =>
    setFormData({ ...formData, [e.target.name]: e.target.value });

  // Add a new room
  const addRoom = () => {
    setRooms([...rooms, { name: "", moisture: "", photo: null }]);
  };

  // Handle room changes
  const handleRoomChange = (index, e) => {
    const newRooms = [...rooms];
    newRooms[index][e.target.name] = e.target.value;
    setRooms(newRooms);
  };

  // Handle image upload
  const handleImageUpload = (index, e) => {
    const newRooms = [...rooms];
    newRooms[index].photo = URL.createObjectURL(e.target.files[0]);
    setRooms(newRooms);
  };

  // CALL AI
  const generateAISummary = async () => {
    setLoadingAI(true);
    try {
      const res = await fetch("http://localhost:5000/generate-ai-summary", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ formData, rooms }),
      });
      const data = await res.json();
      setAiSummary(data.aiSummary);
    } catch (err) {
      alert("AI error");
    }
    setLoadingAI(false);
  };

  // Export PDF
  const exportPDF = () => {
    const doc = new jsPDF();
    doc.setFontSize(14);
    doc.text("ToolbeltAI Mitigation Report", 10, 10);
    doc.text(`Job Address: ${formData.jobAddress}`, 10, 20);
    doc.text(`Job Type: ${formData.jobType}`, 10, 30);
    doc.text(`Insurance: ${formData.insuranceCompany}`, 10, 40);
    doc.text(`Claim #: ${formData.claimNumber}`, 10, 50);

    rooms.forEach((room, i) => {
      doc.text(
        `${room.name} - Moisture: ${room.moisture}`,
        10,
        70 + i * 10
      );
    });

    doc.text("AI Summary:", 10, 110);
    doc.setFontSize(11);
    doc.text(aiSummary || "-- No AI Generated --", 10, 118, { maxWidth: 180 });

    doc.save("Mitigation_Report.pdf");
  };

  return (
    <div style={styles.container}>
      <h2>üõ† ToolbeltAI Mitigation Daily Log</h2>

      <div style={styles.grid3}>
        <input name="jobAddress" placeholder="Job Address" onChange={handleChange} />
        <input name="jobType" placeholder="Type of Job" onChange={handleChange} />
        <input name="insuranceCompany" placeholder="Insurance Co." onChange={handleChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleChange} />
      </div>

      <textarea name="techNotes" placeholder="Technician Notes" onChange={handleChange} style={styles.textarea} />

      <h3>üìè Rooms & Moisture Readings</h3>
      {rooms.map((room, index) => (
        <div key={index} style={styles.roomBox}>
          <input
            name="name"
            placeholder="Room Name"
            value={room.name}
            onChange={(e) => handleRoomChange(index, e)}
          />
          <input
            name="moisture"
            placeholder="Moisture %"
            value={room.moisture}
            onChange={(e) => handleRoomChange(index, e)}
          />
          <input type="file" onChange={(e) => handleImageUpload(index, e)} />
        </div>
      ))}

      <button onClick={addRoom} style={styles.btnAdd}>+ Add Room</button>

      <button onClick={generateAISummary} style={styles.btnAI}>
        {loadingAI ? "Generating..." : "ü§ñ Generate AI Summary"}
      </button>

      {aiSummary && (
        <div style={styles.aiBox}>
          <h3>üß† AI Summary:</h3>
          <p>{aiSummary}</p>
          <button onClick={exportPDF} style={styles.btnPDF}>üìÑ Export PDF</button>
        </div>
      )}
    </div>
  );
};

// CLEAN UI STYLES
const styles = {
  container: { maxWidth: "900px", margin: "auto", padding: "20px" },
  grid3: {
    display: "grid",
    gridTemplateColumns: "repeat(3, 1fr)",
    gap: "10px",
  },
  textarea: { width: "100%", height: "80px", marginTop: "10px" },
  roomBox: {
    border: "1px solid #ddd",
    padding: "10px",
    borderRadius: "6px",
    marginBottom: "10px",
  },
  btnAdd: { background: "#333", color: "white", padding: "6px" },
  btnAI: { background: "#007bff", color: "white", padding: "10px", width: "100%", marginTop: "20px" },
  aiBox: { background: "#f7f7f7", padding: "15px", borderRadius: "6px", marginTop: "15px" },
  btnPDF: { background: "green", color: "white", padding: "8px", marginTop: "10px" },
};

export default MitigationForm;
